webpackJsonp([91760665394868],{1064:function(n,s){n.exports={data:{package:{id:"bs-mysql",score:.14965720636703428,name:"bs-mysql",version:"0.1.2",description:"Bucklescript bindings for mysql.js, written in Reason.",keywords:["databases","mysql","bucklescript"],license:"MIT",updated:"2018-01-13T22:49:57.879Z",stars:null,type:"published",quality:.10417277315839275,popularity:.00496773643671368,maintenance:.3333333333333333,readme:'<h1>MySQL.js Bindings for Reason/Bucklescript</h1>\n<p>This repository contains in-progress Reason/Bucklescript bindings for <a href="https://github.com/mysqljs/mysql">mysql</a>.</p>\n<h2>Example</h2>\n<pre><code class="language-ocaml">let conn = Mysql.connect(~host="127.0.0.1", ~port=3306, ~user="root");\n\nMysql.query(\n  conn,\n  "SHOW DATABASES",\n  (error, results, fields) =>\n    switch (Js.Nullable.to_opt(error)) {\n    | None =>\n      Js.log(results);\n      Js.log(fields)\n    | Some(error) => Js.log(error##message)\n    }\n);\n\nMysql.endConnection(conn);\n</code></pre>\n<h2>Installation</h2>\n<ol>\n<li>Install the bindings using <code>npm install --save bs-mysql</code></li>\n<li>Add the bindings to <code>bsconfig.json</code>:</li>\n</ol>\n<pre><code class="language-json">{\n  "bs-dependencies": [\n      "bs-mysql"\n  ]\n}\n</code></pre>\n<h2>Build</h2>\n<pre><code>npm run build\n</code></pre>\n<h2>Build + Watch</h2>\n<pre><code>npm run start\n</code></pre>\n<h2>Current State &#x26; Todo</h2>\n<p>The API is still very incomplete. Use at your own risk, contributions are welcome!</p>\n',homepageUrl:null,repositoryUrl:null,npmUrl:"https://www.npmjs.com/package/bs-mysql",issuesUrl:null,slug:"packages/bs-mysql"}},pathContext:{id:"bs-mysql"}}}});
